import { useState } from "react";

const img = "https://image.tmdb.org/t/p/w500";

const Card = ({ movie }) => {
  return (
    <div className="card">
      <img
        src={`${img}${movie.poster_path}`}
        className="card-img-top"
        alt="img"
      />

      <p className="card-text">{movie.title}</p>
      <button className="btn"> </button>
    </div>
  );
};
export default Card;
